  const d = new Date();
  const [selectDate, setSelectDate] = useState(`${d.getFullYear()}-${d.getMonth()+1}-1`);
  const [TimeDates, setTimeDates] = useState([]);

  const GetTimeList = async () => {
    const URL = `http://ezaki-lab.littlestar.jp/nict/api/get_start_data.php?date=${selectDate}`;
    const response = await axios.post(URL);

    console.log(response.data);
  }

  // useEffect(() => {
  //   console.log(selectDate);
  //   GetTimeList();
  //   // eslint-disable-next-line react-hooks/exhaustive-deps
  // }, [selectDate]);

  return (
    <div className="App">
      <Calender setSelectDate={GetTimeList}/>
      <TimeList TimeDates={TimeDates}/>
      <Map/>
    </div>
  );
}

export default App;
